Clive Eric Cussler (born July 15, 1931) is an American adventure novelist and marine archaeologist. His thriller novels, many featuring the character Dirk Pitt, have reached The New York Times fiction best-seller list more than seventeen times. Cussler is the founder and chairman of the real-life National Underwater and Marine Agency (NUMA), which has discovered more than sixty shipwreck sites and numerous other notable sunken underwater wreckages. He is the sole author or lead author of more than 50 books.

